def priority(item: float, bins: np.ndarray) -> np.ndarray:
    """Returns priority with which we want to add item to each bin.

    Args:
        item: Size of item to be added to the bin.
        bins: Array of capacities for each bin.

    Return:
        Array of same size as bins with priority score of each bin.
    """
    ratios = item / bins
    priorities = np.zeros(len(bins))

    for i in range(len(bins)):
        if ratios[i] > 0.9:
            if item > 15 and bins[i] > 10:
                priorities[i] = 6
            elif item > 10 and bins[i] > 8:
                priorities[i] = 5
            else:
                priorities[i] = 4
        elif 0.8 <= ratios[i] < 0.9:
            if item > 8 and bins[i] > 5:
                priorities[i] = 4
            elif item > 6 and bins[i] > 4:
                priorities[i] = 3
            else:
                priorities[i] = 2
        elif 0.6 <= ratios[i] < 0.8:
            if item > 4 and bins[i] > 3:
                priorities[i] = 3
            elif item > 2 and bins[i] > 2:
                priorities[i] = 2
            else:
                priorities[i] = 1
        elif 0.4 <= ratios[i] < 0.6:
            if item > 2 and bins[i] > 1:
                priorities[i] = 2
            else:
                priorities[i] = 1
        else:
            if bins[i] >= 1:
                priorities[i] = 1
            else:
                priorities[i] = 0

    return priorities
